import React  from 'react';
import './Team.scss';
import leftCloud  from './utils/images/leftCloud.png';

export function Team() {
    return (
        <div className="team" id="Team">
            <img src={leftCloud} alt=''></img>
            <div className="team__content">
                <div className="team__content__title">
                    <h3>Get inspired by industry leaders</h3>
                </div>
                <div className="team__content__sub">
                    <p>Leaders of the tech industry gather at Hack the North to be speakers, judges, and mentors for hackers 
                        as they build. Stay tuned as we reveal more of our guests this year. Know someone who'd like to speak?
                         Send an email to hello@hackthenorth.com
                    </p>
                </div>
            </div>
            <div className="team__slider">

            </div>
        </div>
    )
}
